    var drawMarker = function(place, root){
        if(root){
            L.polyline([root.latlng ,place.latlng], {color: '#000'}).addTo(markers);
            var pixels = pixelsForCircle(place.students)
            var marker = L.circleMarker(place.latlng, {radius: pixels, color: '#D99343', opacity: 0.7, fillOpacity:0.3})
                .addTo(markers)
            var cras_marker= L.circleMarker(root.latlng, {radius: 4, color: '#343D99', opacity: 0.7, fillOpacity:0.3})
                .addTo(markers)
            marker.on('click', function(){
                this.bindPopup("<strong>" + place.name + "</strong>. "+ place.students +" alumnos<br/>"+root.name);
                this.openPopup();
                console.log('El place es ', place, ' y el place ', root);
                selectPlace(place, root);
                $.getJSON("/apps/cras/show_municipality/"+place.id, {year: year}, function(resp){
                    drawLineChart(resp);
                });
                //console.log('Se va pintar el gráfico de barras')
                
                carga_Municipio(place);
                in_CRAS=false;
            });
            marker.on('mouseover', function(e){
                if(pixels>12){
                    this.setRadius(pixels*1.5)
                }else{
                    this.setRadius(pixels*3)
                }
                this.setStyle({fillOpacity: 0.7})
            })
            marker.on('mouseout', function(){
                this.setRadius(pixels);
                this.setStyle({fillOpacity: 0.3})
            })

            cras_marker.on('click', function(){
                this.bindPopup("<strong>" + root.name + "</strong>.");
                this.openPopup();
                in_CRAS=root;
           		selectedPlace=null;
                selectCra(root);
                //console.log('El cra es ', root);
                carga_CRA(root);

                

            });

            cras_marker.on('mouseover', function(e){
                if(pixels>12){
                    this.setRadius(pixels*1.5)
                }else{
                    this.setRadius(pixels*3)
                }
                this.setStyle({fillOpacity: 0.7})
            })
            cras_marker.on('mouseout', function(){
                this.setRadius(pixels);
                this.setStyle({fillOpacity: 0.3})
            })


        }
        
    }

