var pixelsForCircle = function(students){
    var scaling = students/50
    if(scaling < 1){
        scaling = 1
    }
    return parseInt(scaling*4);
}
var style = function(feature) {
    return {
        weight: 2,
        color: '#000',
        dashArray: '3',
        fillOpacity: 0.1
    };
}

var getCanvasLine = function(elementID){
    $("#"+elementID).remove();
    //$('#chartContainer .canvasLine').empty();
    borraCanvas('CRA');
    $('<canvas>').attr({
        id: elementID,
        height: 150
    }).appendTo('#chartContainer .canvasLine');
    return document.getElementById("canvasLine").getContext("2d");
}

