//Función que borra lso gráficos de los municipios, CRAS o todo
var borraCanvas = function(aBorrar){
	if (aBorrar=='municipio'){
		$('#chartContainer .canvasLine').empty();
		$('#chartContainer .canvasBar').empty();
	}
	else if (aBorrar=='CRA'){
		$('#chartContainerCRA .canvasLine').empty();
		$('#chartContainerCRA .canvasBar').empty();
	}
	else if (aBorrar=='todo'){
		$('#chartContainer .canvasLine').empty();
		$('#chartContainer .canvasBar').empty();
		$('#chartContainerCRA .canvasLine').empty();
		$('#chartContainerCRA .canvasBar').empty();
	}
	
	
}

